Description:
Extra geoms and scales for 'ggplot2', including geom_cloud(),
  a Normal density cloud replacement for errorbars;
  transforms ssqrt_trans and pseudolog10_trans, which are loglike but 
  appropriate for negative data; interp_trans() and warp_trans() which
  provide scale transforms based on interpolation;
  and an infix compose operator for scale transforms.

Author:
Alboukadel Kassambara [aut, cre],
  Indrajeet Patil [ctb] (<https://orcid.org/0000-0003-1995-6531>,
    @patilindrajeets)

description:
The flexibility and excellence of 'ggplot2' is unquestionable, so many drawing  tools basically need 'ggplot2' as the operating object. In order to develop a  heatmap drawing system based on ggplot2, we developed this tool, mainly to solve  the heatmap puzzle problem and the flexible connection between the heatmap and  the 'ggplot2' object.  The advantages of this tool are as follows:  1. More flexible label settings;  2. Realize the linkage of heatmap and 'ggplot2' drawing system, 
   which is helpful for operations such as puzzles; 
3. Simple and easy to operate;  4. Optimization of clustering tree visualization.

